local serialize = setmetatable({
	boolean = function(self, b)
		return tostring(b)
	end,
	number = function(self, n)
		return tostring(n)
	end,

	string = function(self, str)
		return ('%q'):format(str)
	end,

	table = function(self, tbl, i)
		return self(tbl, i)
	end

}, {__call = function(self, tbl, i)
	i = i or 1

	local rep = (' '):rep(i)
	local tmp = {'{'}
	for k,v in next, tbl do
		table.insert(tmp,
			("%s[%s] = %s,"):format(
				rep,
				self[type(k)](self, k),
				self[type(v)](self, v, i+1)
			)
		)
	end

	table.insert(tmp, (i == 1 and '' or rep) ..'}')

	return table.concat(tmp, '\n')
end,})

local scores = {
	main = 1,
	syn = .8,
	short = .5,
	official = 1,
}

local THRESHOLD = 100
local insertOrCreate = function(tbl, aid, weight)
	weight = math.floor(weight)
	if(weight < THRESHOLD) then return end

	local title = animeTitles[aid].main
	if(tbl[aid]) then
		if(tbl[aid][1] == title and tbl[aid][2] < weight) then
			tbl[aid][1] = title
			tbl[aid][2] = weight
		end
	else
		tbl[aid] = {title, weight}
	end
end

local matches = {}
local search = (...):lower():gsub('([-?]+)', '%%%1'):gsub("'", '`')
-- Search, lol!
for aid, adata in next, animeTitles do
	if(search == adata.main:lower()) then
		insertOrCreate(matches, aid, 1000 * scores.main)
	else
		local x, y = adata.main:lower():find(search)
		if(x and y) then
			insertOrCreate(matches, aid, 1000 * (1 + y - x) / #adata.main * scores.main)
		else
			for _, type in next, {'syn', 'short', 'official'} do
				for _, title in ipairs(adata[type]) do
					if(search == title:lower()) then
						insertOrCreate(matches, aid, 1000 * scores[type])
					else
						local x, y = title:lower():find(search)
						if(x and y) then
							insertOrCreate(matches, aid, 1000 * (1 + y - x) / #title * scores[type])
						end
					end
				end
			end
		end
	end
end

local output = {}
for k,v in next, matches do
	table.insert(output, {aid = k, title = v[1], weight = v[2]})
end

table.sort(output, function(a,b) return a.weight > b.weight end)

return serialize(output)
